import React from 'react';
import './catagories.css';

function Catagories(props) {
    return (
        <div className='catagoryContainer'>
            <div className='catagories'>
                <span>
                    <p>HTML</p>
                </span>
                <span>
                    <p>CSS</p>
                </span>
                <span>
                    <p>JavaScript</p>
                </span>
            </div>
        </div>
    );
}

export default Catagories;
